const setRepairPriceReducer = (state = 0, action) => {
    switch (action.type) {
        case "ADD_SMALL_CHIP":
            return state + 60;
        case "ADD_BIG_CHIP":
            return state + 90;
        default:
            return state;
    }
  };

export default setRepairPriceReducer;
